import React from 'react'
import Button, { ButtonProps }  from '@mui/material/Button';
import { useNavigate } from "react-router-dom";

import './More.css'

function More() {
  let navigate = useNavigate(); 
  const routeChange = () =>{ 
    let path = `https://cnu.edu/police/`; 
    navigate(path);
  }
  

  return (
   
    <div className="page">
    <h1 className='header'>Could be anything</h1>
    <p>
      maybe instructions?
    </p>
    <section>
      <Button variant="contained" className='buttons-fun' 
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}> Report a Crime</Button>
      <Button variant="contained" className='buttons-fun'
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}>Report a Crime-Anonymous</Button>
      <Button  variant="contained"className='buttons-fun'
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}>Contact PD anonymous</Button>
      <Button  variant="contained" className='buttons-fun'
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}>Citizen contribution</Button>
      <Button  variant="contained"  className='buttons-fun'
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}> Request Escort</Button>
      <Button  variant="contained" className='buttons-fun'
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}>Campus Map</Button>
      <Button variant="contained" className='buttons-fun'
      style={{
        background:"grey",
        padding:"0px 0px",
        height:"100px",
        width:"100px"
      }}>View Your Reports</Button>
      <Button  variant="contained" className='buttons-fun'
        href="/securityreources"
        style={{
          background:"grey",
          padding:"0px 0px",
          height:"100px",
          width:"100px"
        }}>Security Resources</Button>
    </section>

 
  </div>
  )
}

export default More
